   /**
   * Returns the singleton CodespaceConverter.
   */
   public static CodespaceConverter getInstance() {
      return instance;
   }


  /**
    * Convert a coordinate system "srs" string from MapInfo codespace to EPSG codespace.
    *
    * @param The mapinfo srs string (as returned by Midev) to be converted. e.g. "mapinfo:coordsys 8, 154, 7, 135.0, 0.0, 1.0, 2.35e7, 0.0".
    *        (Note that this string won't necessarily be the same as that used in the mapinfo pro file "MAPINFOW.PRJ")
    * @return The corresponding epsg code, if found, including prefix (e.g. "epsg:21423"). If no corresponding epsg code is found, it simply returns the string passed in.
    */
   public static String getEpsgForMapinfoSrs(String mapinfoSrs)
   {
        if (StringUtils.isBlank(mapinfoSrs))
        {
            return mapinfoSrs;
        }

        String epsgSrs = mapinfoSrs;

        if (lookupTable.containsKey(mapinfoSrs))
        {
            epsgSrs = lookupTable.get(mapinfoSrs);
        }

        return epsgSrs;
   }
